  <doc>
    <field name="type">class</field>
    <field name="name">GoAcceleratorMgr</field>
    <field name="url">class_go_accelerator_mgr.html</field>
    <field name="keywords">GoAcceleratorMgr</field>
    <field name="text">Represents an GoAcceleratorMgr events passed into the acceleration update callback handler bound in by SDK client Meaning of the events are GO_ACCELERATOR_MGR_EVENT_ACCELERATING Sensor acceleration is in progress GO_ACCELERATOR_MGR_EVENT_ACCELERATED Sensor is accelerated successfully GO_ACCELERATOR_MGR_EVENT_DECELERATING Sensor deceleration is in progress GO_ACCELERATOR_MGR_EVENT_DECELERATED Sensor is no longer accelerated GO_ACCELERATOR_MGR_EVENT_STOPPED Sensor acceleration stopped or failed to start GO_ACCELERATOR_MGR_EVENT_DISCONNECTED Accelerated sensor is disconnected from network GO_ACCELERATOR_MGR_EVENT_PROCESS_STOPPED Special case for the STOPPED event to indicate acceleration was in progress but terminated unexpectedly This stop reason differs from other stop reasons such as firmware mismatch etc</field>
  </doc>
  <doc>
    <field name="type">function</field>
    <field name="name">GoAcceleratorMgr::GoAcceleratorMgr_Accelerate</field>
    <field name="args">(GoAcceleratorMgr manager, k32u sensorId, GoAcceleratorMgrSensorParam *param)</field>
    <field name="url">class_go_accelerator_mgr_a5f82c6b6903bb823f82b896f0a5b280e.html#a5f82c6b6903bb823f82b896f0a5b280e</field>
    <field name="keywords">GoAcceleratorMgr_Accelerate GoAcceleratorMgr::GoAcceleratorMgr_Accelerate GoAcceleratorMgr</field>
    <field name="text">Accelerate the specified sensor with the given set of parameters The parameter structure contains the accelerator host IP address to associate with the accelerated sensor and the ports the accelerated sensor should use to communicate with the SDK client If the SDK client wishes to have the GoAcceleratorMgr dynamically/automatically allocate the port numbers from within the configured port range the SDK client must set all the ports in the parameter structure to zero 0 Any non-zero value for a port in the port parameter list is treated as if the client is providing ALL the port numbers to use If the client provided port numbers are valid then they will be used by the accelerated sensor The structure is modified to store actual ports selected if SDK client chose dynamic/automatic port allocation Introduced in firmware 5.2.18.3 manager GoAcceleratorMgr object sensorId Identifier of the sensor param Pointer to parameter structure for accelerating the sensor Operation status</field>
  </doc>
  <doc>

    <field name="keywords">GoAcceleratorMgr_AccelSensorCount GoAcceleratorMgr::GoAcceleratorMgr_AccelSensorCount GoAcceleratorMgr</field>
    <field name="text">Get the number of sensors which the accelerator manager has been configured to accelerate The count includes sensors whose acceleration may have failed for whatever reason This is a convenient interface to find out how many sensors have been configured without having to get the list of sensors This count should match the number of successful calls to GoAcceleratorMgr_Accelerate() less successful calls to GoAcceleratorMgr_Decelerate() Introduced in firmware 5.2.18.3 manager GoAcceleratorMgr object Number of sensors configured for acceleration</field>
  </doc>

    <field name="name">GoSetup::GoSetup_SelectBuiltInEnhancedSurfaceFlatnessFilter</field>
    <field name="args">(GoSetup setup, GoRole role, GoPreFilterType type, GoPreFilterLengthOption length)</field>
    <field name="url">class_go_setup_a8e6cdaaa8a7e84f9fbd791c6590f4fe4.html#a8e6cdaaa8a7e84f9fbd791c6590f4fe4</field>
    <field name="keywords">GoSetup_SelectBuiltInEnhancedSurfaceFlatnessFilter GoSetup::GoSetup_SelectBuiltInEnhancedSurfaceFlatnessFilter GoSetup</field>
    <field name="text">Selects one of the builtin enhanced surface flatness filters to use if device supports enhanced surface flatness filtering Check that the device supports it by calling GoSetup_IsEnhancedSurfaceFlatnessFilterSupported() If enhanced surface flatness filtering is not supported an error code will be returned Caller specifies which type of enhanced surface flatness filter to use and the length of the enhanced surface flatness filter number of filter coefficients Do not use this API to enable custom enhanced surface flatness filtering Use GoSetup_SelectCustomEnhancedSurfaceFlatnessFilter() instead Introduced in firmware 6.3.1.83 setup GoSetup object role Determines which device to retrieve the value from Use GO_ROLE_MAIN or GOROLE_BUDDYIDX(buddyidx) See GoRole for more details type Prefilter type other than GO_PREFILTER_TYPE_CUSTOM length The number of filter coefficients to use in the specified enhanced surface flatness filter mode Operation status</field>
  </doc>
  <doc>
    <field name="type">function</field>
    <field name="name">GoSetup::GoSetup_SelectCustomEnhancedSurfaceFlatnessFilter</field>
    <field name="args">(GoSetup setup, GoRole role, GoPreFilterLengthOption length, const GoPreFilterCoefficient *coefficientsArray)</field>
    <field name="url">class_go_setup_a06d39e55fea8f9d308075e0a2d67fcf0.html#a06d39e55fea8f9d308075e0a2d67fcf0</field>
    <field name="keywords">GoSetup_SelectCustomEnhancedSurfaceFlatnessFilter GoSetup::GoSetup_SelectCustomEnhancedSurfaceFlatnessFilter GoSetup</field>
    <field name="text">Selects using a custom enhanced surface flatness filter if device supports enhanced surface flatness filtering where filter coefficients are provided by the user Check that the device supports it by calling GoSetup_IsEnhancedSurfaceFlatnessFilterSupported() If enhanced surface flatness filtering is not supported an error code will be returned This API sets three things to ensure consistency between all three properties of the custom enhanced surface flatness filter sets the mode to GO_PREFILTER_TYPE_CUSTOM sets the length of the enhanced surface flatness filter and sets the actual coefficients for the enhanced surface flatness filter The number of coefficients in the input array MUST be equal to parameter This is the responsibility of the caller The API cannot know if the input array is too small resulting in accessing memory outside of the actual array possibly leading to unpredictable behaviour Each coefficient value must be with the range of the minimum and maximum allowable values given by GoSetup_CoefficientMinValue() and GoSetup_CoefficientMaxValue() The sum of all the coefficient values must be equal to GoSetup_CoefficientsExpectedSum() NOTE because of the inherent limitations of exactly representing a floating point number the above comparisons to the limits cannot be exact Introduced in firmware 6.3.1.83 setup GoSetup object role Determines which device to retrieve the value from Use GO_ROLE_MAIN or GOROLE_BUDDYIDX(buddyidx) See GoRole for more details length The number of filter coefficients to use in the custom enhanced surface flatness filter coefficientsArray An input array of enhanced surface flatness filter coefficients to use Number of entries MUST be equal to length Operation status</field>
  </doc>

    <field name="text">During construction a GoSystem object uses Gocator Discovery Protocol to locate devices if the autodiscovery capability is selected Subsequently the list of detected devices can be accessed using GoSystem_SensorCount and GoSystem_SensorAt Immediately after construction all sensor objects are in the online state This state indicates that a sensor has been detected but that the client has not yet established a control connection to the sensor The only sensor functions than can be used in this state are GoSensor_State GoSensor_Address and GoSensor_SetAddress Because Gocator Discovery Protocol works across subnets but Gocator Control Protocol does not it is possible for a sensor to be successfully detected but for subsequent connection attempts to fail In this case the GoSensor_SetAddress function can be used to reconfigure the sensor to operate on the same subnet as the client If the client and device are configured to operate on the same subnet the GoSystem_Connect or GoSensor_Connect functions can be used to establish control connections Note that GoSystem and other system API objects such as GoSensor and GoSetup are not thread safe They should not be accessed concurrently by multiple threads without the proper use of synchronization techninques such as mutexes and event loops A typical example of this is when one thread polls GoSensor_State() while another calls functions such as GoSensor_Connect() or GoSystem_Refresh() Without proper locking this code will result in undefined behavior such as invalid values being returned or even program crash Message objects such as GoUniformProfileMsg do not access shared system resources and can be accessed concurrently with system API objects GoSystem_Construct GoSystem_Connect GoSensor_State GoSensor_Address GoSensor_SetAddress</field>
  </doc>

    <field name="text">Reports the Gocator Protocol version implemented by this library A Gocator Protocol version number has a major component and a minor component If the major version implemented by this library is the same as the major version implemented by a sensor device then communication can proceed Otherwise the sensor should be upgraded or a newer version of this library should be obtained Sensors with incompatible major versions will be reported as being in the incompatible state upon connection If major versions match but the minor version implemented by this library is lower than the minor version implemented by the sensor then some sensor features will not be accessible through this library If major versions match but the minor version implemented by this library is higher than the minor version implemented by the sensor then some features exposed by this library may be unimplemented by the sensor This method is thread-safe Introduced in firmware 4.0.10.27 Protocol version implemented by this library GoSensor_ProtocolVersion GoSensor_State</field>

    <field name="text">Overview NOTE For an optimal experience please view this documentation in Mozilla FireFox The Gocator SDK is C library that supports communication with Gocator sensors The main functions of the SDK are under GoSensor This class provides access to all main sensor functionality The Gocator SDK is an open-source library provided under the MIT license Visual Studio project files are included to generate builds for Windows and makefiles are included to generate builds for Linux Compilation has been tested to work with Visual Studios 2017 version 15.9.17 To rebuild on Linux after extracting the contents of the SDK archive first ensure that you have the g++ compiler package and then enter the following in a terminal window Gocator SDK is tested and supported on Windows 7/8/10 We no longer test Gocator SDK with Windows XP or Vista but we don t know of any reason why it would not be compatible Similarly we no longer test for Win32 x86 support but it should work as with previous releases On an X86 Linux distribution use instead The compiled Linux output libraries can be found in the or folder The Gocator SDK has been tested on the following operating system editions Windows 7 64-bit Ubuntu 16.04 64-bit The Gocator SDK uses mm mm 2 mm 3 hertz microseconds and degrees as standard units unless otherwise mentioned</field>
